import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import React from 'react';
import ListaMedicine from './pages/ListaMedicine';
export default function App() {
  return (
    <Router>
      <Switch>
        <Route path="/listamedicine">
          <ListaMedicine />
        </Route>
        <Route path="/users">
          <Users />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}
